export default function Skills() {
    return (
        <div>
            <div>
                <p id="front">Client-side:</p>
                <ul>
                    <li>HTML5</li>
                    <li>CSS3 + SASS</li>
                    <li>Bootstrap</li>
                    <li>jQuery</li>
                    <li>Javascript</li>
                    <li>ReactJS</li>
                    <li>NextJS</li>
                    <li>Materialize</li>
                    <li></li>
                </ul>
            </div>
            <div>
                <p id="back">Server-side:</p>
                <ul>
                    <li>Python</li>
                    <li>Postgres</li>
                    <li>MongoDB</li>
                    <li>MySQL</li>
                    <li>SQLAlchemy</li>
                    <li>Flask</li>
                    <li>Heroku CLI</li>
                    <li>Velcer</li>
                    <li>Netlify</li>
                    <li>Git && Github</li>
                </ul>
            </div>
            <div>

            </div>
            <div>

            </div>
            <style jsx>
                {`
                li {
                    list-style: none;
                    text-align: block;
                },
                body {
                    color: white;
                    font-weight: 200;
                    display: flex;
                    justify-content: center;
                    flex-direction: row;
                },
                p {
                    font-weight: 400;
                }`}
            </style>
        </div>
    )
}
